def find_items_by_label(items: list, label: str) -> list:
  results = []
  for item in items:
    if item['label'] == label:
      results.append(int(item['zipcode']))
    if 'sub_items' in item:
      sub_zipcodes = find_items_by_label(item['sub_items'], label)
      results.extend(sub_zipcodes)
  return results

def find_label_by_zipcode(items: list, zipcode: int) -> str:
  for item in items:
    if int(item['zipcode']) == zipcode:
      return item['label']
    if 'sub_items' in item:
      label = find_label_by_zipcode(item['sub_items'], zipcode)
      if label:
        return label
  return None

def find_zipcode(items: list, zipcode: int) -> bool:
  for item in items:
    if int(item['zipcode']) == zipcode:
      return True
    if 'sub_items' in item:
      label = find_label_by_zipcode(item['sub_items'], zipcode)
      if label:
        return True
  return False

def getZipCode(province: str) -> list: 
  # Get zipcodes 
  zipcodes: list = parse_json_data()
  result: list = []

  results = find_items_by_label(zipcodes, province)
  return results

def getProvince(zipcode: int) -> str:
  zipcodes: list = parse_json_data()

  result = find_label_by_zipcode(zipcodes, zipcode)
  return result

def isReal(zipcode: int) -> bool:
  zipcodes: list = parse_json_data()

  result = find_zipcode(zipcodes, zipcode)
  return result